import botao from './nav.module.css';
import React from 'react';


export default function Menuh(){
    
    return(
        <div >
            <svg height="40" width="50" id="bot" className={botao.bot_h}>
                <path className={botao.tran} d="M 5 5 l 40 0" stroke="white" stroke-width="2" fill="none" />
                <path d="M 20 20 l 25 0"  stroke="white" stroke-width="2" fill="none" />
                <path className={botao.tran} d="M 5 35 l 40 0" stroke="white" stroke-width="2" fill="none" />
                {/* <path className={botao.tran} d="M 35 35 l 10 0" stroke="white" stroke-width="2" fill="none" /> */}
            </svg>
            </div>
    )
    let elemento = document.querySelector('#bot');
console.log(elemento);
    
}
